import React from 'react'
import './styles/card.css'
import { Player } from "../";


// drama
import socialcard from '../img/drama/the-social-network/socialcard.jpg'
import revecard from '../img/drama/the-revenant/revecard.jpg'
import prestcard from '../img/drama/the-prestige/prestcard.jpg'
import kingscard from '../img/drama/kings-speech/kingscard.jpg'
import fightcard from '../img/drama/fight-club/fightcard.jpg'



const drama = [socialcard, revecard, prestcard, kingscard]


export default function Card() {

    return (
        
        <div className = "cards">        
            <div className ="card">
                
                <div className="cardImage">
                    {
                        drama.map(img => <img key={img} src={img} />)
                    }
                </div> 

            </div>  
            
            
        </div>    
            

        

        
    )
}
